    false,nt"url": null,nt"notes": "Control highly aggressive, non-native grasses
    and other invasive plants on 25 acres (Restoration Area 3/5) of former coastal headland
    prairie on Cannery Hill and begin the process of subsequent replacement with native
    coastal grasses and forbs.  Planned activities included chemical and mechanical
    control of invasive grasses and forbs; the collection and grow-out of additional
    native forbs and grasses; and seeding of native sand fescue and forbs.  Replanting
    with native species is as critical to restoration as the elimination of the invasive
    species: if not replaced with natives, the invasive plants will quickly return and
    negate previous control efforts.",nt"license_title": "License Not Specified",nt"extras":
